import React, { useEffect, useState, createElement } from "react";

import Axios from "axios";

import "./App.css";

function App() {
  const [elements, setElements] = useState([]);

  useEffect(() => {
    Axios.post(`${process.env.REACT_APP_SERVER_URL}/fetch-and-scrape`)
      .then((response) => {
        setElements(response.data.html);
        console.log(elements);
      })
      .catch((error) => console.log(error));
    return () => {};
  }, []);

  return (
    <div className="App">
      {elements.map(function (name, index) {
        const CreatedElements = createElement(elements[index][0].tag, {
          className:
            elements[index][0].class !== undefined
              ? elements[index][0].class
              : null,
        });

        return <CreatedElements />;
      })}
    </div>
  );
}

export default App;
